import "./style.css";

function App() {
  return (
    <>
      {/* HEADER */}
      <header className="header">
        <div className="logo">
          <img
            src="logo.png"
            alt="knowledge base logo"
            height="65"
            width="65"
          />
          <h1>Knowledge Base</h1>
        </div>
        <button className="btn btn-large btn-open">Share a fact</button>
      </header>
      <NewFactForm />
      <CategoryFilter />
    </>
  );
}

function NewFactForm() {
  return <fact>Fact form</fact>;
}

function CategoryFilter() {
  return <aside>categoryfilter</aside>;
}

export default App;
